import Vue from 'vue';
import Vuex from 'vuex';

Vue.use(Vuex);

export default new Vuex.Store({
  state: {
    // your state properties
  },
  mutations: {
    // your mutations
  },
  actions: {
    // your actions
  },
  modules: {
    // your modules
  }
});
